	<head>
	<title>Copyright Notice</title>
	<meta name="robots" content="noindex, nofollow">
		<style type="text/css">
			html, body, body>table{
				height: 100%;
				padding: 0;
				margin: 0;
			}
			body, td, th {
				color: #FFFFFF;
				font-family: Arial, Helvetica, sans-serif;
				font-size: 20px;
				line-height: 1.5;
				padding: 0;
			}
			body {
				background: rgb(35,31,32);
				background: -moz-linear-gradient(180deg, rgba(35,31,32,1) 0%, rgba(43,169,152,1) 100%, rgba(0,212,255,1) 100%);
				background: -webkit-linear-gradient(180deg, rgba(35,31,32,1) 0%, rgba(43,169,152,1) 100%, rgba(0,212,255,1) 100%);
				background: linear-gradient(180deg, rgba(35,31,32,1) 0%, rgba(43,169,152,1) 100%, rgba(0,212,255,1) 100%);
				filter: progid:DXImageTransform.Microsoft.gradient(startColorstr="#231f20",endColorstr="#00d4ff",GradientType=1);
			}
			a:link {
				text-decoration: none;
			}
			a:visited {
				text-decoration: none;
				color: #2dc5b0;
			}
			a:hover {
				text-decoration: underline;
				color: #FFF;
			}
			a:active {
				text-decoration: none;
				color: #2dc5b0;
			}
			h1, h2, h3, h4, h5, h6 {
				font-family: Arial, Helvetica, sans-serif;
			}
			a {
				font-family: Arial, Helvetica, sans-serif;
				font-size: 20px;
				font-weight: bold;
				line-height: 1.95;
				color: #2dc5b0;
			}
			h1 {
				font-size: 20px;
				letter-spacing: 0px;
				line-height: 1.9;
				font-weight: bold;
				color: #FFF;
			}
			@media screen and (max-width: 992px) {
				h1{
					font-size: 40px;
					padding: 0 40px;
				}
				p{
					font-size: 30px;
					padding: 0 40px;
				}
				a{
					font-size: 30px;
				}
			}
		</style>
        <meta charset="utf-8">
	</head>
	<body>
	<table width="100%" border="0" cellspacing="0" cellpadding="0">
	  <tr>
		<td align="center">
			<table width="995" border="0" cellspacing="0" cellpadding="15">
				<tr>
					<td align="center">&nbsp;</td>
				</tr>
				<tr>
					<td align="center"><img alt="Copyright Notice" src="./em2.png" title="Copyright Notice"/></td>
				</tr>
				<tr>
					<td align="center"><h1>ACCESS TO THIS WEBSITE HAS BEEN DISABLED BECAUSE THE FEDERAL COURT OF AUSTRALIA HAS DETERMINED THAT IT INFRINGES OR FACILITATES THE INFRINGEMENT OF COPYRIGHT.</h1></td>
				</tr>
				<tr>
					<td height="250" align="center" valign="top">
						<p>Please access the content you are seeking via licensed sites &ndash;<br>
						<a href="https://www.digitalcontentguide.com.au/">www.digitalcontentguide.com.au</a> provides information about many sources of licensed content.
						</p>
					</td>
				</tr>
			</table>
		</td>
	  </tr>
	</table>
</body>
</html>
